If-else statements let some code be conditionally performed. if a < 20 { b = 15
} else { b = 20
} The else portion can be omitted. if a == 0 { b = 10
} As a small exception to the usual parsing of only one statement per newline or semicolon, there can be newlines after the braces of the if body and before the else keyword. if a != 1 { b = 3
}
else { b = 4
}

16.body:
A loop statement contains a list of inner statements. loop { // ...
} The statements of the loop are performed, and then control flow goes back to the start of the loop. break will skip control flow to the end of the loop. continue will move control flow back to the start of the loop. In both cases, when a loop contains another loop, they move to the start or end of the inner-most loop. Loops can be named, allowing for break and continue to go to a loop outside the inner-most loop. 'outer: loop { 'next: loop { a = b loop { if a == 0 { break 'next } else { break 'outer } } }
}
